import React, { useState } from "react";
import { Link, Route, Routes, Navigate, NavLink } from "react-router-dom";
import image from "./images/Img.jpeg";
import image2 from "./images/img2.jpg";
import NavBar from "./component4/NavBar";
import PageOne from "./page/PageOne";
import PageTwo from "./page/PageTwo";
import PageThree from "./page/PageThree";
import PageFour from "./page/PageFour";

function App() {
  const [name, setName] = useState("");
  const [checkIn, setCheckIn] = useState("");

  const handleNewDestination = (event) => {
    setName(event.target.value);
  };

  const handleNewcCheckIn = (event) => {
    setCheckIn(event.target.value);
  };
  const [checkOut, setCheckOut] = useState("");
  const handleNewCheckOut = (event) => {
    setCheckOut(event.target.value);
  };

  return (
    <div>
      <div className="brand">
        <img src={image} className="logo" />
        <h2 className="All">All in one travel app </h2>

        <h7 className="time">{new Date().toLocaleString()}</h7>
      </div>
      {/* <div> */}
      <div className="title">
        <img src={image2} className="img2"></img>
      </div>
      <div className="moveup">
        <h1>
          TRAVEL T<span className="To">0</span> EXPLORE
        </h1>
        <form>
          <div className="search">
            <div className="container">
              <label htmlFor="">where you'd like to go</label>
              <br />

              <input
                type="text"
                placeholder="      Location..."
                className="input"
                value="destination"
                onChange={handleNewDestination}
              />
            </div>
          </div>
          <div className="search">
            <div className="container">
              <label htmlFor="">Check in </label>
              <input
                type="date"
                className="CheckIn"
                value="CheckIn"
                onChange={handleNewcCheckIn}
              />
            </div>
          </div>
          <div className="search">
            <div className="container">
              <label htmlFor="">Check out</label>
              <input
                type="date"
                className="CheckIn"
                value="checkOut"
                onChange={handleNewCheckOut}
              />
            </div>
            <button className="CheckIn">Add to wishList</button>
          </div>
        </form>
        <br></br>
        <br></br>
        <br></br>
        <br></br>
        <NavBar />
        <Routes>
          <Route path="/" element={<Navigate replace to="/page-two" />} />
          <Route path="/page-one" element={<PageOne />} />
          <Route path="/page-two" element={<PageTwo />} />
          <Route path="/page-three" element={<PageThree />} />
          <Route path="/page-four" element={<PageFour />} />
        </Routes>
      </div>
      {/* </div> */}
    </div>
  );
}
